import './App.css';

async function fetchData(e) {
    e.preventDefault();
    const form = e.target;
    const formData = new FormData(form);

    const response = await fetch('http://localhost:3001/download/mp3', {method: form.method, body: `{ "url": "${formData.get('url')}" }`})
    console.log(response)



}

function App() {
    return (<div>
        <h1>Youtube MP3 Downloader</h1>
        <form method='post' onSubmit={fetchData}>
            <input name="url"/>
            <br/>
            <button type="submit">Download</button>
        </form>
    </div>)
}

export default App;
